import React from "react";
import { useSpring, animated } from "react-spring";

const Check = () => {
  const circleProps = useSpring({
    from: { strokeDashoffset: 280 },
    to: { strokeDashoffset: 0 },
    config: { duration: 500 },
  });

  const stemProps = useSpring({
    from: { strokeDashoffset: 50 },
    to: { strokeDashoffset: 0 },
    config: { duration: 500, delay: 300 },
  });

  const kickProps = useSpring({
    from: { strokeDashoffset: 70 },
    to: { strokeDashoffset: 0 },
    config: { duration: 500, delay: 600 },
  });

  return (
    <div className="check-animation-container">
      <svg viewBox="0 0 100 100" className="check-mark">
        <animated.circle
          cx="50"
          cy="50"
          r="40"
          fill="transparent"
          strokeWidth="3"
          stroke="#5cb85c"
          strokeLinecap="round"
          style={circleProps}
        />
        <animated.line
          x1="30"
          y1="50"
          x2="45"
          y2="65"
          stroke="#5cb85c"
          strokeWidth="3"
          strokeLinecap="round"
          style={stemProps}
        />
        <animated.line
          x1="45"
          y1="65"
          x2="70"
          y2="35"
          stroke="#5cb85c"
          strokeWidth="3"
          strokeLinecap="round"
          style={kickProps}
        />
      </svg>
      <p className="success-message">Payment Successful!</p>
    </div>
  );
};

export default Check;
